
const {
  createCanvas,
  loadImage
} = require('canvas')

module.exports = {

  "DevTool": function(ws, inst) {
		
	var ObjectTransformer = new AVROS.Thing("ObjectTransformer")

	ObjectTransformer.set({
		"type": "empty",
		"scale": {
			"x": 1,
			"y": 1,
			"z": 1
		}
	})
	var TranformerBody = new AVROS.Thing("TranformerBody")

	TranformerBody.set({
		"parent": ObjectTransformer.id,
		"type": "cube",
		"scale": {
			"x": 0.08,
			"y": 0.1,
			"z": 0.02
		}
	})
	
	var SensorSphere = new AVROS.Thing("SensorSpere")

	SensorSphere.set({
		"parent": ObjectTransformer.id,
		"type": "sphere",
		"scale": {
			"x": 0.03,
			"y": 0.03,
			"z": 0.03
		},
		"position": {
			"x": 0.00,
			"y": 0.07,
			"z": 0.00
		}
	})
	
	var MonitorPlane = new AVROS.Thing("MonitorPlane")

	MonitorPlane.set({
		"type": "plane",
		"parent": TranformerBody.id,
		"scale": {
			"x": 0.09,
			"y": 0.00,
			"z": 0.06
		},
		"position": {
		  "x": 0.0,
		  "y": 0.15,
		  "z": -0.51
		},
		"eulerRotation": {
		  "x": 90,
		  "y": 180,
		  "z": 0
		}
	})
		
	var canvas = createCanvas(200, 200)
	var ctx = canvas.getContext('2d')

	ctx.fillStyle = "#000000"
	ctx.fillRect(0, 0, 200, 200)

	ctx.fillStyle = "#00FF00"
	ctx.font = '10px Impact'
	ctx.fillText('Transformer ready.', 50, 100)


    inst.SpawnAsInterest(ws, ObjectTransformer)
	
    inst.DescribeObject(ws, TranformerBody)
    inst.DescribeObject(ws, MonitorPlane)
    inst.DescribeObject(ws, SensorSphere)
	
	inst.SetTexture(ws, MonitorPlane, canvas)
	
	inst.AddTag(ws, TranformerBody, "GrabMyParent")
	inst.AddTag(ws, TranformerBody, "Grabable")
	inst.AddTag(ws, ObjectTransformer, "Scalable")
	
	inst.SetTextureBase64(ws, SensorSphere, ElectricTextureBase64)
	inst.SetTextureBase64(ws, TranformerBody, MetallicTextureBase64)
  }
}










var MetallicTextureBase64 = ""
	
var ElectricTextureBase64 = ""